import { Component } from '@angular/core';
import { Anime } from 'src/app/model/anime';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  public anime: Anime[] = new Array<Anime>();

  constructor(){
    this.anime.push(new Anime(1, "Dragon Ball", 1986, 9))
    this.anime.push(new Anime(2, "Dragon Ball Kai", 2009, 5))
  }

}
